import Document, { Html, Head, Main, NextScript, DocumentContext } from 'next/document'

class MyDocument extends Document {
  static async getInitialProps(ctx: DocumentContext) {
    const initialProps = await Document.getInitialProps(ctx)
    return { ...initialProps }
  }

  render() {
    return (
      <Html>
        <title>TIO:Talk It Out</title>
        <Head>
            <meta property="og:site_name" content="Talk It Out"/>
            <meta property="twitter:site_name" content="Talk It Out"/>
            <meta property="twitter:card" content="summary"/>
            <meta property="og:type" content="website"/>
            {/* <meta property="og:image" content={process.env.NEXT_PUBLIC__BASE_URL}/> */}
            <link rel="preconnect" href="https://fonts.gstatic.com" />
            <link href="https://fonts.googleapis.com/css2?family=IBM+Plex+Sans:wght@100;200;300;400;500;600;700&display=swap" rel="stylesheet" />  
            <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/5.15.1/css/all.min.css" integrity="sha512-+4zCK9k+qNFUR5X+cKL9EIR+ZOhtIloNl9GIKS57V1MyNsYpYcUrUeQc9vNfzsWfV28IaLL3i96P9sdNyeRssA==" crossOrigin="anonymous" /> 
            <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/prism/1.5.0/themes/prism.min.css"/>  
        </Head>
        <body className="font-body" style={{backgroundColor: '#DAE0E6'}}>
          <Main />
          <NextScript />
          <script src="https://cdnjs.cloudflare.com/ajax/libs/prism/1.5.0/prism.min.js"></script>
        </body>
      </Html>
    )
  }
}

export default MyDocument
